import { Component } from '@angular/core';
import { MyService } from 'src/app/services/my.service';

@Component({
  selector: 'app-mybookings',
  templateUrl: './mybookings.component.html',
  styleUrls: ['./mybookings.component.css']
})
export class MybookingsComponent {
  table;
constructor(private getm:MyService){

}
ngOnInit(){
  this.getm.getbookings().subscribe((res)=>{
    this.table=res;
  })
}
onsubmit(data){
  this.getm.updatebookings(data);
}

}
<table class="table table-striped table-hover table-bordered">
  <thead class="thead-dark">
    <tr>
      <th>Booking Id</th>
      <th>From Destination</th>
      <th>To Destination</th>
      <th>Price (USD)</th>
      <th>Date</th>
    </tr>
  </thead>
  <tbody>
    <tr *ngFor="let travel of table">
      <td>{{ travel.id }}</td>
      <td>{{ travel.fromDestination }}</td>
      <td>{{ travel.toDestination }}</td>
      <td>${{ travel.price }}</td>
      <td>{{ travel.date }}</td>
      <button type="button" [disabled]="!registrationForm.valid" class="btn btn-light" (click)="onsubmit(travel)">Update</button>
      <td>From Registration<input type="text"></td>
      <td>From Registration<input type="text">To Registration</td>
    </tr>
  </tbody>
</table>
